INSERT INTO `groups` (`id`, `name`, `description`, `context`, `prerequisite`, `email`, `image`, `restrict_access`, `chat_link`, `drive_link`, `status`, `state`, `visibility`, `creator_id`, `creation_date`) VALUES
	(1, 'GT Finances', 'Ce groupe s\'occupe de gérer les finances de l\'association. Il gère les dons, les dépenses, les demandes d\'argent, et gère le compte bancaire.', 'Ce groupe a été créé après un problème avec les finances. Le problème était que trop peu de personnes s\'en occupaient.', 'Connaissances minimales en comptabilité requises. Le reste peu être appris sur le tas si vous voulez vous intégrer dans ce groupe. De la rigueur administrative est aussi de mise.', NULL, 'group_5ecjoxx4zzza8cni2zv4t523buef6n.jpg', 0, 'chat.link/join?v=8yyxop3hbs0', 'drive.link/open?f=s47gf0dcf27dzkrxs8cgcev03v7xyt160qyfknn37meco4bjwsks6ola', 'Travail une fois par mois pour les tâches répétitives', 3, 3, 45, '2019-10-13 02:22:11'),
	(2, 'GT Réflexion interne', 'Groupe pour réfléchir au fonctionnement interne.', 'Différentes tensions entre certains membres.', 'A partir du moment que vous avez constaté ou pu expérimenter des problèmes internes dans l\'organisation et la structure, vous êtes aptes à travailler dans ce groupe.', 'interne@assoc.ch', 'group_oivabk34kanwygt3vywoeplzf0lqox.jpg', 0, 'chat.link/join?v=glxiqb54xokdpv', 'drive.link/open?f=tkvb778l7wq950zzcflxveqh6db4trc7zojhq2fffrd1m7flo2jf1aphh9q985gz', '', 1, 3, 35, '2019-05-10 20:09:15'),
	(3, 'Coordination', 'Coordination générale. Fait des AG toutes les 2 semaines.', 'Besoin d\'un groupe contenant tout les membres.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quis enim confidit semper sibi illud stabile et firmum permansurum, quod fragile et caducum sit? -, sed ut hoc iudicaremus, non esse in iis partem maximam positam beate aut secus vivendi. Duo Reges: constructio interrete. Quod autem meum munus dicis non equidem recuso, sed te adiungo socium. Et si turpitudinem fugimus in statu et motu corporis, quid est cur pulchritudinem non sequamur? An me, inquis, tam amentem putas, ut apud imperitos ', 'coordination@assoc.ch', 'group_ufgdaawfard697vev4q7biit5onz1v.jpg', 1, 'chat.link/join?v=tvqakkjzw8e', 'drive.link/open?f=3682xyrz7dlxg0kfgv3ngwnk31qtlzmidhp0ou5p2psdzshcetg6zr8bs2f9yam9', '', 2, 3, 68, '2020-02-27 22:25:01'),
	(4, 'GT Journal', 'Collaboration avec un journal régional mensuel pour un prochain numéro consacré à l\'association. Le journal sera publié fin mai.', 'Envie de prendre place dans l\'espace médiatique et de se faire connaître...', 'Aimer écrire ou dessiner. Les textes sont travaillés très longtemps avant d\'arriver dans leur phase finale.', NULL, NULL, 0, 'chat.link/join?v=1rhoy8csk3s3d3', 'drive.link/open?f=2y8ntysa0icyjajpkid6nu5rdu5huovdaimx9trcilgj6yejlhmy1', 'En pause pour cause du covid et reporté en septembre.', 1, 3, 100, '2019-06-20 17:47:29'),
	(5, 'GT Festival', 'Organise les "festivals" annuels de l\'association.', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Quibus natura iure responderit non esse verum aliunde finem beate vivendi, a se principia rei gerendae peti; Vides igitur te aut ea sumere, quae non concedantur, aut ea, quae etiam concessa te nihil iuvent. At cum de plurimis eadem dicit, tum certe de maximis. Qui enim existimabit posse se miserum esse beatus non erit. Apparet statim, quae sint officia, qu', 'festival@assoc.ch', 'group_2mzics1tk66xw6d3q6hsqmplj4pqud.jpg', 0, 'chat.link/join?v=szury9b5qd9y4', 'drive.link/open?f=ksq5hwp8o93y5dcs6yoi2xy1rzqnxjv7zqnx99r4tcj7z6ae7vm4oh3amcihz2x', '', 1, 4, 45, '2020-09-06 17:41:18'),
	(6, 'GT Multimédia', 'Crée tous les design et médias dont l\'association a besoin. Affiches, vidéos, photos, montages, ...', 'Rassemblement des personnes créatives de l\'association.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi. Sit, inquam, tam facilis, quam vultis, comparatio voluptatis, quid de dolore dicemus? Sin est etiam corpus, ista explanatio naturae nempe hoc effecerit, ut ea, quae ante explanationem tenebamus, relinquamus. Non quam nostram quidem, inquit Pomponius iocans; Idne consensisse de Calatino plurimas gentis arbitramur, primarium populi fuisse, quod praestantissimus fuiss', NULL, 'group_2fg2k8ip25uujr77t4tfyegn4puusp.jpg', 0, 'chat.link/join?v=sbzdtvu8eysvc', 'drive.link/open?f=t2vahuxtkbr09thbd5w7zxpgpi4b8q2jmdqjpvap2ewluw7inrmcpztc28tgnco541u', 'Peu actif...', 1, 3, 71, '2020-05-12 14:28:19'),
	(7, 'GT Sites web', 'Ce GT s\'occupe des sites web et de leur maintenance.', 'Besoin de connaissances un peu technique et des personnes qui se portent responsables.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Duo Reges: constructio interrete. Hoc est non modo cor non habere, sed ne palatum quidem. \n\n', 'web@assoc.ch', NULL, 1, 'chat.link/join?v=rs6bqmmsvwkxcvq', 'drive.link/open?f=pdz5s3x5eix3iydfdk2s88faoy60enq6f1qw0p92vmi55pqnoftm95d', 'Travail actif sur le site cantonal...', 2, 3, 58, '2020-03-08 04:03:02'),
	(8, 'GT Communication', 'Gére toute la communication interne et externe de l\'association. Gère les différents réseaux sociaux.', '', NULL, NULL, NULL, 0, 'chat.link/join?v=vhefcsr0r6arh', 'drive.link/open?f=iipf9033dd0ifk8pd2gaf9xytxo2lmminwsznqaglhw0fxhexjf', 'Textes et messages envoyés tous les jours. Très actif pour la réfléxion.', 2, 3, 79, '2020-03-10 07:22:47'),
	(9, 'GT Education', 'Fait des formations en ligne pour des membres internes et externes.', 'Volonté de se former au thèmes de l\'association.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quaeque de virtutibus dicta sunt, quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Item de contrariis, a quibus ad genera formasque generum venerunt. \n\n', NULL, NULL, 0, 'chat.link/join?v=6u9qjj1d5s7a1ia', 'drive.link/open?f=6rq4hrtfjr7rzsj8cny5634g3lhtkw94dfvbg9iuhvgpp0ctf6lcwkmjlxqq0ji72uexzj', 'Formations intenses entre le 15 et le 23. Ensuite pause.', 3, 3, 63, '2019-03-20 01:57:29'),
	(10, '"GT" relations externes', 'Permet de gérer les relations externes, que ce soit les médias, la presse, les demandes d\'interview, ...', 'Beaucoup de demandes d\'interview après le festival 2019.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Tum Triarius: Posthac quidem, inquit, audacius. Ego vero volo in virtute vim esse quam maximam; Nam si beatus umquam fuisset, beatam vitam usque ad illum a Cyro extructum rogum pertulisset. Duo Reges: constructio interrete. Nunc omni virtuti vitium contrario nomine opponitur. Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Quae rursus dum sibi evelli ex ordine nolunt, horridiores evadunt, asperiores, duriore', 'externes@assoc.ch', NULL, 1, 'chat.link/join?v=nf4i91pr6ij', 'drive.link/open?f=ebxuk5edliogvioohvzgca78tyfogtmhs17vn662a0ox5pv9lcpwi5cjjv', '', 1, 3, 74, '2019-09-23 02:34:12'),
	(11, 'GT boîte mail', 'Gestion de la boite mail et réponses aux messages.', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sit ista in Graecorum levitate perversitas, qui maledictis insectantur eos, a quibus de veritate dissentiunt. Ne in odium veniam, si amicum destitero tueri. Duo Reges: constructio interrete. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Ita ne hoc quidem modo paria peccata sunt. Tertium autem omnibus aut maximis', NULL, 'group_blwt3uw94psz9n8xtmy1fym3exo8b2.jpg', 0, 'chat.link/join?v=9pm86ipyuq', 'drive.link/open?f=n7o0ssacr9j9e4f18u8y700vpkcv9wzrg167dy1iu1se7uzhjjhfdnpwlwnoliyd7', 'Une personne gère la boite mail par jour et ce tous les jours.', 3, 3, 34, '2019-10-14 01:56:29'),
	(12, 'GT Anniversaire', 'Organisation de la fête annuel de l\'anniversaire du collectif, qui consiste simplement en un apéro sur une soirée.', 'Moment de plaisir et de détente pour changer des périodes de l\'année intense en travail.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quid, si reviviscant Platonis illi et deinceps qui eorum auditores fuerunt, et tecum ita loquantur? Dicuntur ista, Cato, magnifice, inquam, sed videsne verborum gloriam tibi cum Pyrrhone et cum Aristone, qui omnia exaequant, esse communem? Ita fit ut, quanta differentia est in principiis naturalibus, tanta sit in finibus bonorum malorumque dissimilitudo. \n\n', NULL, NULL, 1, 'chat.link/join?v=4927tiovpmpl7xa', 'drive.link/open?f=0xgpviht38vajy69lvh9dyv3ouxczo48gr4bdu2guu7p4e9ajxdqr', 'Nouveau projet pour les 20 ans démarré.', 1, 1, 8, '2019-08-09 04:44:04'),
	(13, 'GT Bien-être', 'S\'occupe de gérer les conflits à l\'interne et de veiller au bien-être de chaque membre, via la boîte aux lettres.', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Non enim iam stirpis bonum quaeret, sed animalis. Sed et illum, quem nominavi, et ceteros sophistas, ut e Platone intellegi potest, lusos videmus a Socrate. De ingenio eius in his disputationibus, non de moribus quaeritur. Facile pateremur, qui etiam nunc agendi aliquid discendique causa prope contra naturam vígillas suscipere soleamus. Tu enim ista lenius, hic Stoicorum more nos vexat. Duo Reges: constructio interrete. Ne seges quidem ', NULL, NULL, 1, 'chat.link/join?v=8t0dnrza91', 'drive.link/open?f=65d866jblzkdczefu0j0hyi5ijdb0dqnlij62khpfzc0fs0596zxh', 'Diverses conflits sont en cours d\'être géré mais cela prend du temps...', 2, 2, 6, '2020-08-22 08:02:30');
