	(3, 3, 'Lorem ipsum dolor sit amet,', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Restant Stoici, qui cum a Peripateticis et Academicis omnia transtulissent, nominibus aliis easdem res secuti sunt. Nam Metrodorum non puto ipsum professum, sed, cum appellaretur ab Epicuro, repudiare tantum beneficium noluisse; Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Iam quae corporis sunt, ea nec auctoritatem cum animi partibus, comparandam et cognitionem habent faciliorem. Videamus animi partes, quarum est conspectus illustrior; Duo Reges: constructio interrete. \n\n', '2020-03-11 05:20:01', 1, 1, 2, 'https://asdfsdafsda.casdfsdaf/Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam Metrodorum non puto ipsum professum, sed, cum appellaretur ab Epicuro, repudiare tantum beneficium noluisse; Ille igitur vidit, non modo quot fuissent adhuc philosophorum de summo bono, sed quot omnino esse possent sententiae. Duo Reges: constructio interrete. Tum Piso: Atqui, Cicero, inquit, ista studia, si ad imitandos summos viros spectant, ingeniosorum sunt; Ex quo illud efficitur, qui bene cenent omnis libenter cenare, qui libenter, non continuo bene. Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; \n\n', '2020-06-06 08:28:20', 40, 28, 2),
	(4, 4, 'Lorem ipsum dolor sit', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? Quid est, quod ab ea absolvi et perfici debeat? Et quidem, Cato, hanc totam copiam iam Lucullo nostro notam esse oportebit; Duo Reges: constructio interrete. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Nam haec ipsa mihi erunt in promptu, quae modo audivi, nec ante aggrediar, quam te ab istis, quos dicis, instructum videro. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Huius, Lyco, oratione locuples, rebus ipsis ielunior. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? \n\n', '2020-08-06 07:29:59', 0, 2, 2, 'https://asdfsdafsda.casdfsdaf/Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quis est, qui non oderit libidinosam, protervam adolescentiam? Sit, inquam, tam facilis, quam vultis, comparatio voluptatis, quid de dolore dicemus? Huic ego, si negaret quicquam interesse ad beate vivendum quali uteretur victu, concederem, laudarem etiam; Qualem igitur hominem natura inchoavit? Duo Reges: constructio interrete. Non dolere, inquam, istud quam vim habeat postea videro; Nosti, credo, illud: Nemo pius est, qui pietatem-; Haec qui audierit, ut ridere non curet, discedet tamen nihilo firmior ad dolorem ferendum, quam venerat. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Quid ad utilitatem tantae pecuniae? Et quidem Arcesilas tuus, etsi fuit in disserendo pertinacior, tamen noster fuit; Illud dico, ea, quae dicat, praeclare inter se cohaerere. \n\n', '2019-04-25 13:14:23', 40, 1, 5),
	(5, 5, 'Lorem ipsum dolor sit amet,', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ergo in utroque exercebantur, eaque disciplina effecit tantam illorum utroque in genere dicendi copiam. Ex quo illud efficitur, qui bene cenent omnis libenter cenare, qui libenter, non continuo bene. Negat esse eam, inquit, propter se expetendam. Ita, quem ad modum in senatu semper est aliquis, qui interpretem postulet, sic, isti nobis cum interprete audiendi sunt. Duo Reges: constructio interrete. Quid de Platone aut de Democrito loquar? Aliud igitur esse censet gaudere, aliud non dolere. Facile est hoc cernere in primis puerorum aetatulis. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Et adhuc quidem ita nobis progresso ratio est, ut ea duceretur omnis a prima commendatione naturae. Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. \n\n', '2019-03-19 11:03:08', 1, 3, 1, 'https://asdfsdafsda.casdfsdaf/Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duo Reges: constructio interrete. Et summatim quidem haec erant de corpore animoque dicenda, quibus quasi informatum est quid hominis natura postulet. Ut necesse sit omnium rerum, quae natura vigeant, similem esse finem, non eundem. Te enim iudicem aequum puto, modo quae dicat ille bene noris. Ego, quam ille praeponendam et magis eligendam, beatiorem hanc appello nec ullo minimo momento plus ei vitae tribuo quam Stoici. Tenesne igitur, inquam, Hieronymus Rhodius quid dicat esse summum bonum, quo putet omnia referri oportere? Equidem soleo etiam quod uno Graeci, si aliter non possum, idem pluribus verbis exponere. Quis autem honesta in familia institutus et educatus ingenue non ipsa turpitudine, etiamsi eum laesura non sit, offenditur? \n\n', '2019-05-07 19:19:01', 39, 17, 11),
	(6, 6, 'Lorem ipsum dol', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nec enim ignoras his istud honestum non summum modo, sed etiam, ut tu vis, solum bonum videri. Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Duo Reges: constructio interrete. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. Quid enim ab antiquis ex eo genere, quod ad disserendum valet, praetermissum est? \n\n', '2020-03-10 07:51:42', 0, 5, 3, 'https://asdfsdafsda.casdfsdaf/Lorem ipsum dolor sit amet, consectetur adipiscing elit. Scis enim me quodam tempore Metapontum venisse tecum neque ad hospitem ante devertisse, quam Pythagorae ipsum illum locum, ubi vitam ediderat, sedemque viderim. Sic exclusis sententiis reliquorum cum praeterea nulla esse possit, haec antiquorum valeat necesse est. Quod si ita est, sequitur id ipsum, quod te velle video, omnes semper beatos esse sapientes. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Duo Reges: constructio interrete. Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? \n\n', '2020-08-08 02:17:24', 54, 39, 25),
